import Header from "./components/header/Header"
import Main from "./components/main/Main";

function App() {
  return (
    <>
      <Header />
      <Main src = "https://i.pinimg.com/564x/c5/af/a7/c5afa70fa29e3a1729d0f5aeb5630d25.jpg"
      alt = "Gryffindor"/>
      <Main src = "https://i.pinimg.com/564x/4d/ab/0a/4dab0a87210b79bfbb9adbb5432847be.jpg"
      alt = "Ravenclaw"/>
      <Main src = "https://i.pinimg.com/564x/62/45/f9/6245f9e0fe98a75e37f1e4d7103066ed.jpg"
      alt = "Slytherin"/>
      <Main src = "https://i.pinimg.com/564x/ad/76/e8/ad76e8070c8a922a4a2920c28b6bb07b.jpg"
      alt = "Hufflepuff"/>
    </> 
  );
}

export default App;
